«Мой Авто» – бесплатное приложение для записи и обслуживания автомобиля

Удобная запись на ремонт всех марок авто: Toyota, Volkswagen, Hyundai, Škoda, Chevrolet, BMW, Renault, Chevrolet, Kia, Ford, Nissan, Skoda, Audi, VAZ и др. Укажите в приложении нужную услугу, дату и время. Из 20 проверенных автосервисов выберите лучший, по выгодной цене.

Помощник автовладельцу:
- история ремонтов автомобиля расходы,
- напоминания техобслуживания,
- расход топлива,
- запись в ближайший автосервис онлайн,
- электронная сервисная книжка.

Бесплатный автоэксперт заменит тысячу бумаг и номеров телефонов. В нем вы найдете:
- напоминания о ремонтах
- напоминания по дате и/или пробегу
- информация по обслуживанию автомобиля расходы,
- карта ближайших автосервисов,
- проверенные автосервисы в “Избранном”
- сохранение и ведение учета всех работ, производимых с 
  автомобилем: ремонт подвески, ремонт двигателя,
- синхронизация данных в сервисную книжку из заказ-нарядов, 
  созданных в автосервисах - партнерах.

Наши автосервисы-партнёры – проверенные СТО, оказывающие целый ряд услуг:
- ТО авто;
- ремонт машины;
- автомойка;
